import React from 'react';
import './App.css';

function Nav() {
  return (
    <nav>
        <ul className="nav-links">
            <li>Storm</li>
            <li>Wietske</li>
            <li>Sandra</li>
            <li>Rahima</li>
        </ul>
    </nav>
  );
}

export default Nav;
